    const condition = useSelector((state)=>state.condition); 
    return (
        <>
        <Typography component={'div'} sx={{width:'100%', height:'170px', backgroundColor:theme.palette.mainColor.main, display:'flex', justifyContent:'center', alignItems:'center', flexDirection:'column'}} className="background">
            <h2 className="text-center" style={{color:'#ffffff', fontSize:'30px', fontWeight:'bold'}}>conduit</h2>
            <p className="text-center" style={{color:'#ffffff',fontSize:'20px'}}> A place to share Knowledge </p>
        </Typography>
        </>
    )
}
